import React from 'react'; 


const Header = () => (
  <div className="header"> 
    <ul>
      <li>More Cool Clothes</li>
      <li>Whats goin' on</li>
      <li>Log in</li>
      <p>Sign Up</p>
    </ul>
  </div>
);


export default Header;
